script: |
  super -f text -I q8105.spq | sort > q8105.out

inputs:
  - name: q8105.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) WHERE NOT 40 BETWEEN - + 65 + + CAST ( - + col1 AS INTEGER ) * - + col1 AND 17;
  - name: tab1

outputs:
  - name: q8105.out
    data: |
      51	14	96
      85	5	59
      91	47	68
